import styled from "styled-components";
import theme from "../../../Logic/theme";

const { primary, secondary, tri, quad, background, primaryColor } = theme;

const Container = styled.div`
  width: 95%;
  margin: 0 auto;
`;

const Spells = () => {
  return <div>I am spells</div>;
};

export default Spells;
